import { useNavigate } from 'react-router-dom';

const GetStarted = () => {
  const navigate = useNavigate();

  const handleProductSelect = product => {
    navigate('/checkout', { state: { product } });
  };

  return (
    <div className="getStartedWrap">
      <div className="liveBlock">
        <span className="liveNumber">451</span>
        Live users checking out
      </div>

      <form className="getStartedForm">
        <div className="getStartedFormTitle">Enter Your Order Details </div>
        <div className="inputsBlock">
          <div className="userNameBlock">
            <input id="userName" type="text" />
            <label htmlFor="userName"></label>
          </div>
        </div>
      </form>

      <button onClick={() => handleProductSelect('TikTok Likes Package')}>
        Select Likes Package
      </button>
      <button onClick={() => handleProductSelect('TikTok Views Package')}>
        Select Views Package
      </button>
    </div>
  );
};

export default GetStarted;
